    return (

            <div>
                <div>!!! МО-ЛО-ДЕЦ !!!</div>

                <ButtonLink
                    name='ВЫ-БЕ-РИ  НАГ-РА-ДУ'
                    onclick={props.onclick}
                    classname=''
                    to='/prizeShop'
                />
            </div>

     )
}

export default FinaleTakePrize
